import React from 'react';
import Paper from "@material-ui/core/Paper";


function Question({getquestionid, question}) {

   const q = question => {
       return getquestionid(question.id);
   }


    return(
        <Paper>
            <h1>Question Details</h1>
            <p>{q.title}</p>
            <p>{q.category}</p>
        </Paper>
    )
}

export default Question;
